import React, { Component } from 'react'

import Container from '../Container'
import './Cliente.css'

export default class Cliente extends Component {
    state = {
        nome: "",
        cpf: "",
        telefone: ""
    }
    
    txtNome_change = (event) => {
        this.setState({nome: event.target.value})
    }

    txtCpf_change = (event) => {
        this.setState({cpf: event.target.value})
    }

    txtTelefone_change = (event) => {
        this.setState({telefone: event.target.value})
    }

    gravarNovo = () => {
        const dados = {
            "nome": this.state.nome,
            "cpf": this.state.cpf,
            "telefone": this.state.telefone,
            "logradouro":"Rua M",
            "numero": "1",
            "nomeBairro": "Mirante"
        }

        const requestOptions = {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            
            body: JSON.stringify(dados)
        };

        const url = "http://localhost:3002/cliente/incluir"

        fetch(url, requestOptions)
            .then(console.log('Gravado'))
            .catch(erro => console.log(erro));
    }
    
    render() {
        return (            
            <Container>
                <h1>Identificação</h1>
                <div><div>
                    <h3>Dados Pessoais</h3>
                    <form className="box">
                        <div>
                        <h2>Nome</h2>
                        <input value={this.state.nome} onChange={this.txtNome_change} type="text"></input>
                        </div>
                        
                        <h2>CPF</h2>
                        <input value={this.state.cpf} onChange={this.txtCpf_change}  type="text"></input>
                        <h2>Telefone</h2>
                        <input value={this.state.telefone} onChange={this.txtTelefone_change} type="text"></input>
                    </form>
                    </div>
                    <button className="button" onClick = {() => this.gravarNovo()}>Gravar</button>
                </div>
            </Container>
        )
    }
}
